@ajtourville fiber is wound over rotor at high tension load. machine to do this was made by tesla automation.

carbon sleeve must put copper rotor in compression or it loosens at low temp due to differential thermal expansion. 

preload is also helpful for maintaining precise gap to stator.

@flcnhvy @thatdogegirl @whatsupfranks @teslagong becoming multiplanetary is one of the greatest filters. only now, 4.5 billion years after earth formed, is it possible. 

