@spacex360 ascent phase, transition to horizontal &amp; control during free fall were good. 

a (relatively) small ch4 leak led to fire on engine 2 &amp; fried part of avionics, causing hard start attempting landing burn in ch4 turbopump. 

this is getting fixed 6 ways to sunday.

@wintonark strange, if true. 

- tesla already uses iron-phosphate for medium range cars made in our shanghai factory.

- a monocell is electrochemically impossible, as max voltage is ~100x too low. maybe they meant cells bonded together, like our structural battery pack?

most importantly, every electric car, tesla or otherwise, matters to the environment we all share. every time someone chooses electric, the future gets a little bit brighter!

